struct K { name: String, age: f64,
} #[derive(Debug)]
struct S { name: String, b: Vec<K>,
} impl S { fn new(name: &str) -> Self { S { name: name.to_string(), b: Vec::new(), } } fn get(&self, name: &str) -> f64 { for k in &self.b { if k.name == name { return k.age; } } -1.0 } fn put(&mut self, name: &str, age: f64) { self.b.push(K { name: name.to_string(), age, }); }
} fn main() { let mut s = S::new("Bob"); s.put("Bob", 12.0); s.put("Alice", 13.0); println!("bob's age: {:?}", s.get("Bob")); println!("{:?}", s);
}

