This gets a little more complicated. But, it's important. We have to make sure all the variables have the same lifetime. fn greet<'a>( names: &mut Vec<&'a str>, target_name: &'a str, custom_message: &'a str, standard_message: &'a str,
) { for name in names.iter_mut() { *name = match name { &mut n if n == target_name => custom_message, _ => standard_message, } }
} fn main() { let greeting = "Well, hello Ferris!"; let mut names = vec!["Bob", "Frank", "Ferris"]; greet(&mut names, "Ferris", greeting, "hi"); println!("{:?}", names);
} // Ref:
